import React from "react";
import { Search as SearchIcon } from "react-bootstrap-icons";
import s from "./style.module.css";

const SearchBar = (props) => {
  return (
    <>
      <SearchIcon size={27} className={s.icon} />
    </>
  );
};

export default SearchBar;
